import React from 'react';

const post = (props)=>(
    <div>
        <h5>{props.name}</h5>
        <img src={props.image} alt=""/>
        <button >fav</button>
        <style jsx>
        {`
            div {
                display: flex;
                justify-content: space-between;
                align-items: center;
                margin: 0 0;
            }
            h5{
            color: blue;
            }
            div {
            background: red;
            }
            @media (max-width: 600px) {
            div {
                background: grey;
            }
            }
        `}    
        </style>

    </div>
);



export default post;
